        <div className="shadow-lg">
            <label>Username</label>
            <input type="text" />
            <label>Email</label>
            <input type="email" />
            <label>Phone Number</label>
            <input type="tel" />
            <label>Password</label>
            <input type="password" />
            <label>Confirm Password</label>
            <input type="password" />
        </div>
    );
};

export default Login;
